import axios from 'axios'

const NOTES = 'notes'
const NOTES_API_URL = `http://localhost:8089/${NOTES}`


class NotesDataService {

    retrieveAllNotes() {
        return axios.get(`${NOTES_API_URL}/all`);
    }
}

export default new NotesDataService()
